/*Table structure for table `teaofexam` */

DROP TABLE IF EXISTS `teaofexam`;

CREATE TABLE `teaofexam` (
  `Sub_No` varchar(50) NOT NULL COMMENT '科目编号',
  `TeaNo` varchar(100) NOT NULL COMMENT '教师工号',
  `signstate` int(11) DEFAULT NULL COMMENT '教务办审核是否通过',
  `schoolstate` int(11) DEFAULT NULL COMMENT '教务处审核是否通过',
  `exampass` int(11) DEFAULT NULL COMMENT '查看哪些人考试通过',
  `exampassTime` datetime DEFAULT NULL COMMENT '考试通过时间',
  `studypassTime` datetime DEFAULT NULL COMMENT '必修学习完成时间',
  PRIMARY KEY (`Sub_No`,`TeaNo`),
  CONSTRAINT `FK_Relationship_2` FOREIGN KEY (`Sub_No`) REFERENCES `examsubject` (`Sub_No`)
